import React, { useState, useEffect } from 'react';

const STRATEGY_LABELS = {
  cross: "Cross-Exchange",
  inter: "Inter-Asset",
  triangular: "Triangular",
  stat: "Statistical",
  funding: "Funding"
};

function Scanner() {
  const [allOpps, setAllOpps] = useState({});
  const [strategy, setStrategy] = useState("cross");
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchData = async () => {
      setLoading(true);
      setError(null);
      try {
        const response = await fetch('http://localhost:3000/api/opportunities');
        if (!response.ok) throw new Error(`HTTP error! status: ${response.status}`);
        const data = await response.json();
        setAllOpps(data);
      } catch (err) {
        setError("Failed to fetch data. Please ensure the backend server is running and accessible.");
      } finally {
        setLoading(false);
      }
    };
    fetchData();
    const intervalId = setInterval(fetchData, 30000);
    return () => clearInterval(intervalId);
  }, []);

  const opps = allOpps[strategy] || [];

  return (
    <div className="mb-4 bg-gray-700 p-6 rounded-md shadow-inner">
      <div className="flex flex-col md:flex-row justify-between items-center mb-4">
        <h2 className="text-2xl font-bold text-blue-300 mb-2 md:mb-0">
          Opportunities ({STRATEGY_LABELS[strategy]})
        </h2>
        <select
          value={strategy}
          onChange={e => setStrategy(e.target.value)}
          className="bg-gray-800 text-white px-3 py-2 rounded"
        >
          {Object.keys(STRATEGY_LABELS).map(key => (
            <option key={key} value={key}>{STRATEGY_LABELS[key]}</option>
          ))}
        </select>
      </div>

      {loading && <p className="text-blue-300 text-center text-lg">Loading opportunities...</p>}
      {error && <p className="text-red-500 text-center text-lg">{error}</p>}

      {!loading && !error && (
        opps.length > 0 ? (
          <div className="overflow-x-auto">
            <table className="min-w-full bg-gray-800 border border-gray-600 rounded-lg">
              <thead className="bg-gray-700">
                <tr>
                  {/* Adjust columns as needed for each strategy */}
                  {strategy === "cross" && (
                    <>
                      <th className="px-4 py-3">Pair</th>
                      <th className="px-4 py-3">Buy From</th>
                      <th className="px-4 py-3">Buy Price</th>
                      <th className="px-4 py-3">Sell To</th>
                      <th className="px-4 py-3">Sell Price</th>
                      <th className="px-4 py-3">Profit %</th>
                    </>
                  )}
                  {strategy === "inter" && (
                    <>
                      <th className="px-4 py-3">Exchange</th>
                      <th className="px-4 py-3">Profit %</th>
                      <th className="px-4 py-3">ETH/USDT</th>
                      <th className="px-4 py-3">Implied</th>
                    </>
                  )}
                  {/* Add more columns for other strategies as needed */}
                </tr>
              </thead>
              <tbody className="divide-y divide-gray-700">
                {opps.map((op, i) => (
                  <tr key={i}>
                    {strategy === "cross" && (
                      <>
                        <td>{op.pair}</td>
                        <td>{op.buyEx || op.buyExchange}</td>
                        <td>${parseFloat(op.buyPrice).toLocaleString()}</td>
                        <td>{op.sellEx || op.sellExchange}</td>
                        <td>${parseFloat(op.sellPrice).toLocaleString()}</td>
                        <td>{op.profitPercent || op.profitPercentage}%</td>
                      </>
                    )}
                    {strategy === "inter" && (
                      <>
                        <td>{op.exchange}</td>
                        <td>{op.profitPercent}%</td>
                        <td>{op.ethUsdt}</td>
                        <td>{op.implied}</td>
                      </>
                    )}
                    {/* Add more row rendering for other strategies */}
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        ) : (
          <p className="text-gray-400 text-center text-lg">No arbitrage opportunities found.</p>
        )
      )}
    </div>
  );
}

export default Scanner;
